In een alternatief universum is de Justice League een wrede groep die de orde op aarde handhaaft. 
Superman is de zoon van generaal Zod en werd als kind naar de aarde gestuurd en 
daar opgevoed door een familie van Mexicaanse immigranten. 
Batman is Kirk Langstrom, een wetenschapper die zich per ongeluk in een vampier 
heeft veranderd in een poging zijn kanker te genezen. 
Hij voedt zich met criminelen. 
Wonder Woman is Bekka, de bruid van de nieuwe god Orion. 
Nadat enkele vooraanstaande wetenschappers op mysterieuze wijze om het leven komen, 
verdenken de overheden dat de Justice League hier iets mee te maken heeft.

